import { StyleSheet, ImageBackground, Image, Text } from "react-native";
import { NativeBaseProvider, Box, Container, Header, Divider, Body, HStack, Content, Card, CardItem } from 'native-base';
import { Ionicons } from '@expo/vector-icons';

export default function TabTwoScreen() {
  return (
      <NativeBaseProvider>
        <AppBar />
        <Divider />
        <ImageBackground imageStyle=
          {{ opacity: 0.5 }} style={styles.image} source={require('../assets/images/splashbg.png')} resizeMode="cover" />

        <Container>
          <Header />
          <Content padder>
            <Card>
              <CardItem header bordered>
                <Text>NativeBase</Text>
              </CardItem>
              <CardItem bordered>
                <Body>
                  <Text>
                    NativeBase is a free and open source framework that enable
                    developers to build high-quality mobile apps using React
                    Native iOS and Android apps with a fusion of ES6.
                  </Text>
                </Body>
              </CardItem>
              <CardItem footer bordered>
                <Text>GeekyAnts</Text>
              </CardItem>
            </Card>
          </Content>
        </Container>
      </NativeBaseProvider>
    );
  }

function AppBar() {
  return (
    <>
      <Box safeAreaTop backgroundColor="#f2e6d9" />

      <HStack bg='#e6e600' px="1" justifyContent='space-between' alignItems='center'>
        <HStack space="4" alignItems='center'>
          <Image style={styles.coin} source={require('../assets/images/icon2.gif')} />
        </HStack>
        <HStack space="2">
          <Text style={styles.icon}>
            <Ionicons name="ios-person-circle-outline" size={20} /> David Williams
          </Text>
        </HStack>
      </HStack>

    </>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  icon: {
    color: 'black',
    fontSize: 16,
    fontWeight: 'bold',


  },
  balance: {
    fontSize: 25,
    width: '100%',
  },
  coin: {
    width: 50,
  },
  coingif: {
    size: '100%',
  },
  coingif: {
    width: 10,
  },
  image: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    width: '100%',
  },
  title: {
    width: 400,
    resizeMode: 'cover',
    marginTop: -100,
    marginBottom: -100,
    margin: -100,
  },
  header: {
    marginTop: '15%',
    marginLeft: '18%',
    justifyContent: 'flex-start',
    alignItems: 'flex-start',
    backgroundColor: '#fff',
  },
});
